import styled from 'styled-components';
import Container from '../../../Layout/Container';
import Header from '../Header';
import Table from '../Table';

import MarginBlock from '../../../Layout/MarginBlock';

const StyledRooms = styled.div`
  width: 100%;
  height: 60%;
  border-bottom: 1px solid #fff;
`;

const Rooms = ({}) => {
  const dataPrimary = [
    {
      data: 'Username',
      center: true,
    },
    {
      data: 'Color',
    },
    {
      data: 'Team',
      center: true,
    },
    {
      data: 'Figure',
    },
  ];

  const rowsData = [
    [
      {
        data: 'catdev',
        center: true,
      },
      {
        data: 'Infinity waves',
      },
      {
        data: '#1',
        center: true,
      },
      {
        colorSpaceship: 'rgb(0,255,0)',
      },
    ],
    [
      {
        data: 'loooooooll2525',
        center: true,
      },
      {
        data: 'Infinity waves',
      },
      {
        data: '#1',
        center: true,
      },
      {
        colorSpaceship: 'rgb(0,255,0)',
      },
    ],
  ];

  return (
    <StyledRooms>
      <Header>
        <p
          style={{
            fontSize: '16px',
            fontWeight: 700,
            letterSpacing: '2px',
            marginLeft: '22px',
          }}
        >
          NEW GAME
        </p>
      </Header>
      <Container width="80%">
        <MarginBlock height="30px"></MarginBlock>
        <Table
          lineEveryRow
          widthCells={[20, 20, 20, 35]}
          dataPrimary={dataPrimary}
          rowsData={rowsData}
        />
      </Container>
    </StyledRooms>
  );
};

export default Rooms;
